const body = $input.first().json.body || {};
const message = (typeof body.message === 'string') ? body.message : '';
let sessionId = (typeof body.session_id === 'string') ? body.session_id : '';
if (!sessionId || sessionId.trim() === '') {
  sessionId = 'SESSION-' + Date.now() + '-' + Math.random().toString(36).substring(2, 15) + Math.random().toString(36).substring(2, 8);
} else if (/\.\.[\/\\]/.test(sessionId)) {
  throw new Error('Invalid session_id format');
}
let sanitizedMessage = message.replace(/<[^>]*>/g, '').trim();
if (sanitizedMessage.length > 1500) {
  sanitizedMessage = sanitizedMessage.substring(0, 1500);
}
return {
  json: {
    message: '[Data atual: ' + (() => {
  const now = new Date();
  const month = now.getUTCMonth();
  const isDST = month >= 2 && month <= 9;
  const offset = isDST ? 0 : -1;
  const local = new Date(now.getTime() + offset * 3600000);
  const days = ['domingo','segunda-feira','terça-feira','quarta-feira','quinta-feira','sexta-feira','sábado'];
  const months = ['janeiro','fevereiro','março','abril','maio','junho','julho','agosto','setembro','outubro','novembro','dezembro'];
  return days[local.getUTCDay()] + ', ' + local.getUTCDate() + ' de ' + months[local.getUTCMonth()] + ' de ' + local.getUTCFullYear() + ', ' + String(local.getUTCHours()).padStart(2,'0') + ':' + String(local.getUTCMinutes()).padStart(2,'0');
})() + '] ' + (sanitizedMessage || 'hello'),
    session_id: sessionId,
    headers: $input.first().json.headers || {},
    query: $input.first().json.query || {}
  }
};

const inputData = $input.first().json;
const flowiseResponse = inputData.text || inputData.output || '';
const isFallback = !flowiseResponse || flowiseResponse.trim() === '';

let sessionId = 'unknown';
let customerMessage = '';
try {
  const validateData = $('Validate Input').first().json;
  sessionId = validateData.session_id || 'unknown';
  customerMessage = validateData.message || '';
} catch (e) {}

let output = flowiseResponse;
if (isFallback) {
  output = '[INTENT:error] Peço desculpa, mas não consegui processar o seu pedido neste momento. Por favor, tente novamente ou entre em contacto connosco através de geral@estragaferro.com ou +351 295 628 298 / +351 915 032 185.';
}

// Extract [INTENT:xxx] tag
let llmIntent = null;
const intentMatch = output.match(/^\s*\[INTENT:(\w+)\]/);
if (intentMatch) {
  llmIntent = intentMatch[1].toLowerCase();
  output = output.replace(/^\s*\[INTENT:\w+\]\s*/, '');
}

// Check for QUOTE_DATA
let quoteData = null;
let hasQuote = false;
const quoteMatch = output.match(/\[QUOTE_DATA\]\s*(\{[\s\S]*?\})\s*\[\/QUOTE_DATA\]/);
if (quoteMatch) {
  try {
    quoteData = JSON.parse(quoteMatch[1].trim());
    if (!quoteData.customer_name || !quoteData.customer_email || !quoteData.products_description) {
      quoteData = null;
    } else {
      // Validate email
      if (quoteData.customer_email && !/^[^\s@]+@[^\s@]+\.[^\s@]+$/.test(quoteData.customer_email)) {
        quoteData = null;
      } else {
        quoteData.reference_id = 'QUOTE-' + Date.now() + '-' + Math.random().toString(36).substring(2, 10).toUpperCase();
        quoteData.session_id = sessionId;
        quoteData.created_at = new Date().toISOString();
        for (const key of Object.keys(quoteData)) {
          if (typeof quoteData[key] === 'string') {
            quoteData[key] = quoteData[key].replace(/[\n\r]/g, ' ').substring(0, 500);
          }
        }
        hasQuote = true;
      }
    }
  } catch (e) { quoteData = null; }
}

// Check for ORDER_DATA
let orderData = null;
let hasOrder = false;
const orderMatch = output.match(/\[ORDER_DATA\]\s*(\{[\s\S]*?\})\s*\[\/ORDER_DATA\]/);
if (orderMatch) {
  try {
    orderData = JSON.parse(orderMatch[1].trim());
    if (!orderData.customer_name || !orderData.customer_email || !orderData.issue_description) {
      orderData = null;
    } else {
      // Validate email
      if (orderData.customer_email && !/^[^\s@]+@[^\s@]+\.[^\s@]+$/.test(orderData.customer_email)) {
        orderData = null;
      } else {
        orderData.reference_id = 'SUPPORT-' + Date.now() + '-' + Math.random().toString(36).substring(2, 10).toUpperCase();
        orderData.session_id = sessionId;
        orderData.created_at = new Date().toISOString();
        for (const key of Object.keys(orderData)) {
          if (typeof orderData[key] === 'string') {
            orderData[key] = orderData[key].replace(/[\n\r]/g, ' ').substring(0, 500);
          }
        }
        hasOrder = true;
      }
    }
  } catch (e) { orderData = null; }
}

// Clean response
let cleanResponse = output
  .replace(/\[QUOTE_DATA\]\s*\{[\s\S]*?\}\s*\[\/QUOTE_DATA\]/, '')
  .replace(/\[ORDER_DATA\]\s*\{[\s\S]*?\}\s*\[\/ORDER_DATA\]/, '')
  .trim();

if (hasQuote && quoteData) {
  cleanResponse = cleanResponse.replace(/QUOTE-X+/g, quoteData.reference_id);
}
if (hasOrder && orderData) {
  cleanResponse = cleanResponse.replace(/ORDER-X+/g, orderData.reference_id);
  cleanResponse = cleanResponse.replace(/SUPPORT-X+/g, orderData.reference_id);
}

let classifiedIntent = 'general';
if (hasQuote) classifiedIntent = 'quote_request';
else if (hasOrder) classifiedIntent = 'support_request';
else if (llmIntent) classifiedIntent = llmIntent;

return [{
  json: {
    output: cleanResponse,
    hasQuote,
    hasOrder,
    quoteData,
    orderData,
    referenceId: hasQuote ? quoteData?.reference_id : (hasOrder ? orderData?.reference_id : null),
    sessionId,
    originalMessage: customerMessage,
    classifiedIntent,
    isFallback
  }
}];

let processData;
try {
  processData = $('Process Response').first().json;
} catch (e) {
  processData = { output: 'Request processed. Please contact geral@estragaferro.com for confirmation.', sessionId: 'unknown', referenceId: null, classifiedIntent: 'quote_request' };
}
const emailInput = $input.first().json;
const emailSuccess = emailInput && !emailInput.error;
return [{
  json: {
    response: processData.output,
    intent: 'quote_request',
    session_id: processData.sessionId,
    reference_id: processData.referenceId,
    quote_submitted: emailSuccess,
    email_error: emailSuccess ? undefined : (emailInput?.error?.message || 'Email delivery failed'),
    timestamp: new Date().toISOString()
  }
}];

let processData;
try {
  processData = $('Process Response').first().json;
} catch (e) {
  processData = { output: 'Request processed. Please contact geral@estragaferro.com for confirmation.', sessionId: 'unknown', referenceId: null, classifiedIntent: 'support_request' };
}
const emailInput = $input.first().json;
const emailSuccess = emailInput && !emailInput.error;
return [{
  json: {
    response: processData.output,
    intent: 'support_request',
    session_id: processData.sessionId,
    reference_id: processData.referenceId,
    support_submitted: emailSuccess,
    email_error: emailSuccess ? undefined : (emailInput?.error?.message || 'Email delivery failed'),
    timestamp: new Date().toISOString()
  }
}];

let processData;
try {
  processData = $('Process Response').first().json;
} catch (e) {
  processData = { output: 'Em que posso ajudar?', sessionId: 'unknown', classifiedIntent: 'general' };
}
return [{
  json: {
    response: processData.output,
    intent: processData.classifiedIntent || 'general',
    session_id: processData.sessionId,
    timestamp: new Date().toISOString()
  }
}];
